import React, { useState } from 'react';
import {
  Box,
  Container,
  Grid,
  Paper,
  Typography,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import {
  Add as AddIcon,
  Delete as DeleteIcon,
  Edit as EditIcon,
  Visibility as ViewIcon,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

// Dummy data for demonstration
const dummyCases = [
  {
    id: 'CASE001',
    type: 'Mortgage Application',
    value: '£250,000',
    loan: '£200,000',
    questionnaireStatus: 'Completed',
    documentsOutstanding: 2,
    status: 'In Review',
  },
  {
    id: 'CASE002',
    type: 'Refinance',
    value: '£300,000',
    loan: '£240,000',
    questionnaireStatus: 'In Progress',
    documentsOutstanding: 5,
    status: 'Draft',
  },
];

const ClientDashboard: React.FC = () => {
  const navigate = useNavigate();
  const [deleteDialogOpen, setDeleteDialogOpen] = useState(false);
  const [selectedCase, setSelectedCase] = useState<string | null>(null);

  const handleCreateCase = () => {
    navigate('/client/new-enquiry');
  };

  const handleViewCase = (caseId: string) => {
    navigate(`/case/${caseId}`);
  };

  const handleDeleteCase = (caseId: string) => {
    setSelectedCase(caseId);
    setDeleteDialogOpen(true);
  };

  const confirmDelete = () => {
    // Implement delete logic here
    setDeleteDialogOpen(false);
    setSelectedCase(null);
  };

  const getStatusColor = (status: string) => {
    switch (status.toLowerCase()) {
      case 'in review':
        return 'warning';
      case 'draft':
        return 'info';
      case 'completed':
        return 'success';
      default:
        return 'default';
    }
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Grid container spacing={3}>
        {/* Header Section */}
        <Grid item xs={12}>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
            <Typography variant="h4" component="h1">
              My Mortgage Cases
            </Typography>
            <Button
              variant="contained"
              startIcon={<AddIcon />}
              onClick={handleCreateCase}
            >
              New Mortgage Enquiry
            </Button>
          </Box>
        </Grid>

        {/* Cases Table */}
        <Grid item xs={12}>
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Case ID</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Value</TableCell>
                  <TableCell>Loan</TableCell>
                  <TableCell>Questionnaire Status</TableCell>
                  <TableCell>Documents Outstanding</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {dummyCases.map((case_) => (
                  <TableRow key={case_.id}>
                    <TableCell>{case_.id}</TableCell>
                    <TableCell>{case_.type}</TableCell>
                    <TableCell>{case_.value}</TableCell>
                    <TableCell>{case_.loan}</TableCell>
                    <TableCell>{case_.questionnaireStatus}</TableCell>
                    <TableCell>{case_.documentsOutstanding}</TableCell>
                    <TableCell>
                      <Chip
                        label={case_.status}
                        color={getStatusColor(case_.status)}
                        size="small"
                      />
                    </TableCell>
                    <TableCell>
                      <IconButton
                        size="small"
                        onClick={() => handleViewCase(case_.id)}
                        color="primary"
                      >
                        <ViewIcon />
                      </IconButton>
                      <IconButton
                        size="small"
                        onClick={() => handleDeleteCase(case_.id)}
                        color="error"
                      >
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Grid>
      </Grid>

      {/* Delete Confirmation Dialog */}
      <Dialog open={deleteDialogOpen} onClose={() => setDeleteDialogOpen(false)}>
        <DialogTitle>Delete Case</DialogTitle>
        <DialogContent>
          <Typography>
            Are you sure you want to delete case {selectedCase}? This action cannot be undone.
          </Typography>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDeleteDialogOpen(false)}>Cancel</Button>
          <Button onClick={confirmDelete} color="error" variant="contained">
            Delete
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default ClientDashboard;
